import React, { Component } from 'react';
import Paper from '@material-ui/core/Paper';
import ExpansionPanel from '@material-ui/core/ExpansionPanel';
import ExpansionPanelSummary from '@material-ui/core/ExpansionPanelSummary';
import ExpansionPanelDetails from '@material-ui/core/ExpansionPanelDetails';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

import './css/FirstPage.css'
import moment from 'moment';

class CalendarWeek extends Component {
  componentDidMount(){
    const { resetMonth } = this.props;
    resetMonth();
  }
  render() {
    const {
      resetMonth, month, tasks, prevMonth, nextMonth
    } = this.props;
    return (
      <div>
        <Paper>
          <p>Календарь</p><p>Месяц с {month.firstMonthDate} по {month.lastMonthDate}</p>
          <br/>
          <button onClick={() => prevMonth({
            selectFirst: month.firstMonthDate,
            selectLast: month.lastMonthDate
          }
          )}
          >
            Предыдущая неделя
          </button>
          <button onClick={resetMonth}>Текущая неделя</button>
          <button onClick={() => nextMonth({
            selectFirst: month.firstMonthDate,
            selectLast: month.lastMonthDate
          }
          )}
          >
            Следующая неделя
          </button>
        </Paper>
      </div>
    );
  }
}

export default CalendarWeek;
